import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <h2> Welcome to Netflix Clone </h2>
      <video width="700px" height="400px" controls>
        <source src="https://d3bwy9cq4btnw5.cloudfront.net/50%20Cent%20-%20In%20Da%20Club%20(Official%20Music%20Video).mp4" type="video/mp4"/>
      </video>


    </div>
  );
}

export default App;
